import './ProjectCard.css';

export default function ProjectCard({ image, title, description, technologies, codeLink, liveLink }) {
  return (
    <section className="project-section">
      <div className="project-card">
        <img src={image} alt={title} className="project-image" />
        <div className="project-content">
          <div>
            <h2 className="project-title">{title}</h2>
            <p className="project-description">{description}</p>
            <div className="project-techs">
              {technologies.map((tech, i) => (
                <img key={i} src={tech} alt={`tech-${i}`} />
              ))}
            </div>
          </div>
          <div className="project-buttons">
            <a href={codeLink} target="_blank" rel="noopener noreferrer" className="project-button">Code</a>
            <a href={liveLink} target="_blank" rel="noopener noreferrer" className="project-button live">Live</a>
          </div>
        </div>
      </div>
    </section>
  );
}
